import React from "react";

const Tree = (props) => {
  return (
    <div>
      <div>{props.address}</div>
      {[...props.tree].map((tx, i) => (
        <div
          id={i}
          onClick={(e) => {
            props.triggerFetch(e.target.innerHTML);
          }}
          style={{}}
        >
          {tx}
        </div>
      ))}
    </div>
  );
};

export default Tree;
